/* Back to top button */
.cssanimations #backToTopBtn {
    display: block;
    visibility: visible;
    -webkit-transform: translate(0px, 0px);
    -moz-transform: translate(0px, 0px);
    -ms-transform: translate(0px, 0px);
    -o-transform: translate(0px, 0px);
    transform: translate(0px, 0px);
    -webkit-transition: -webkit-transform 0.35s ease-in-out;
    -moz-transition: -moz-transform 0.35s ease-in-out;
    -o-transition: -o-transform 0.35s ease-in-out;
    transition: transform 0.35s ease-in-out;
    -webkit-backface-visibility: hidden;
}
.cssanimations #backToTopBtn.off { 
	visibility: hidden; 
	-webkit-transform: translate(0px, 80px); 
	-moz-transform: translate(0px, 80px); 
	-ms-transform: translate(0px, 80px); 
	-o-transform: translate(0px, 80px); 
	transform: translate(0px, 80px); 
	-webkit-transition: visibility 0s, -webkit-transform 0.35s ease-in-out; 
	-webkit-transition-delay: 0.35s, 0s; 
	-moz-transition: visibility 0s 0.35s, -moz-transform 0.35s ease-in-out; -o-transition: visibility 0s 0.35s, -o-transform 0.35s ease-in-out; 
	transition: visibility 0s 0.35s, transform 0.35s ease-in-out; 
}
#backToTopBtn {
    width: 40px;
    height: 40px;
    display: block;
    overflow: hidden;
    position: fixed;
    right: 10px;
    bottom: 10px;
    z-index: 999;
    text-indent: 100%;
    white-space: nowrap;
    background: #000000;
    color: #ffffff;
    filter: progid:DXImageTransform.Microsoft.Alpha(Opacity=50);
    opacity: 0.5;
	-webkit-border-radius: 5px 5px 5px 5px;
    -moz-border-radius: 5px 5px 5px 5px;
    -ms-border-radius: 5px 5px 5px 5px;
    -o-border-radius: 5px 5px 5px 5px;
    border-radius: 5px 5px 5px 5px;
}
#backToTopBtn:before {
    width: 100%;
    height: 28px;
    margin-top: -14px;
    display: block;
    position: absolute;
    top: 50%;
    left: 0;
    text-indent: 0;
    text-align: center;
    font: 28px/28px FontAwesome;
    content: "\f106";
}
#backToTopBtn:hover { 
	filter: progid:DXImageTransform.Microsoft.Alpha(Opacity=75); 
	opacity: 0.75; 
}

