.cater_subheader{
 font-size: 26px; 
text-transform: uppercase;
font-weight: bold;
}
.text_container {
    min-height: 275px;
    font-size: 20px;
    color: #ffffff;
    position: relative;
    padding: 40px 48px 35px 60px;
    background-size: cover;
    background-image: url('images/Txt_bkg.png');
    background-position: bottom right;
    background-size: 100%;
    background-repeat: no-repeat;	
}


#top_container .text_container {
    background-color: #ffb900;
}

#mid_container .text_container {
    background-color: #0097ac;

}

#bottom_container .text_container {
    background-color: #11366c;
}

.text_container.arrow_right:after
 {
    z-index: 10;
    position: absolute;
    left: 100%;
    top: 45%;
    margin-top: -9px;
    content: '';
    width: 0;
    height: 0;
    border-top: solid 24px transparent;
    border-bottom: solid 24px transparent;
    border-left: solid 23px #ffb900;
}

#mid_container .text_container.arrow_left:after {
    z-index: 10;
    position: absolute;
    right: 100%;
    top: 45%;
    margin-top: -10px;
    content: '';
    width: 0;
    height: 0;
    border-top: solid 24px transparent;
    border-bottom: solid 24px transparent;
    border-right: solid 23px #0097ac;
}

#bottom_container .text_container.arrow_right:after
 {
    z-index: 10;
    position: absolute;
    left: 100%;
    top: 45%;
    margin-top: -9px;
    content: '';
    width: 0;
    height: 0;
    border-top: solid 24px transparent;
    border-bottom: solid 24px transparent;
    border-left: solid 23px #11366c;
}

.photo_container {
   display: block;
   min-height: 275px;
   background-size: cover !important;
}

.btn.small {
   font-size: 18px;
   margin-top: 30px;
}

.btn.smallBlue {
   font-size: 18px;
   margin-top: 30px;
   background: #0097ac;
	color: #fff !important;
}
.btn,
.btn:visited {
    color: #1b3668 !important;
}
.btn:hover {
    color: #fff !important;
}


@media screen and (min-width: 992px) {
/* Equal height columns */
	.row.equal-height {
		/*flex-wrap: wrap;
		 -webkit-flex-wrap: wrap; */
		display: -webkit-box;      /* OLD - iOS 6-, Safari 3.1-6 */
		display: -moz-box;          	/*	OLD - Firefox 19- (buggy but mostly works) */
		display: -ms-flexbox;      /* TWEENER - IE 10 */
		display: -webkit-flex;     /* NEW - Chrome */
		display: flex;             /* NEW, Spec - Opera 12.1, Firefox 20+ */ 
	}
	.row.equal-height > [class*='col-'] {
		display: flex;
		flex-direction: column;
		-webkit-flex-direction: column;
		display: block;		
	}

}

@media screen and (max-width: 991px) {

